var scene, camera, renderer;
var planet;
var controls;
var earthMaterial, jupiterMaterial;

var planetType = 0;
var clock = new THREE.Clock();

function init()
{
	// Create a scene
	scene = new THREE.Scene();
	var aspectRatio = window.innerWidth / window.innerHeight;
	
	// Create a camera
	camera = new THREE.PerspectiveCamera(30, aspectRatio, 0.1, 10000);
	camera.position.z = 20;
	
	// Create a renderer
	renderer = new THREE.WebGLRenderer();
	renderer.setSize(window.innerWidth, window.innerHeight);
	renderer.setClearColor(0x000000);
	
	// orbit controls
	controls = new THREE.OrbitControls(camera);
	controls.minDistance = 10;
	controls.maxDistance = 100;

	document.getElementById("container").appendChild(renderer.domElement);

	// Add ambient and spot lights
	scene.add(new THREE.AmbientLight(0x333333));

	var ambientLight = new THREE.AmbientLight(0xFFFF99);
	scene.add(ambientLight);

	var light = new THREE.PointLight(0xFFFFFF, 1, 0);
	light.position.set(0, 0, 0);
	scene.add(light);

	// Texture images of planets from :
	//http://planetpixelemporium.com/jupiter.html
	// Data url of images generated using http://dataurl.net/#dataurlmaker
	var earthTextureDataurl= "data:image/jpeg;base64,";
	var earthBumpTextureDataurl = "data:image/jpeg;base64,";
	var earthTexture = THREE.ImageUtils.loadTexture(earthTextureDataurl);
	var earthBumpTexture = THREE.ImageUtils.loadTexture(earthBumpTextureDataurl);

	earthMaterial = new THREE.MeshPhongMaterial({
		color: 0xaaaaaa,
		ambient: 0xaaaaaa,
		specular: 0x333333,
		map: earthTexture,
		bumpMap: earthBumpTexture,
		bumpScale: 0.5,
		shininess: 10
	});

	var jupiterTexture = THREE.ImageUtils.loadTexture('mars.jpg');
	var jupiterBumpTexture = THREE.ImageUtils.loadTexture('mars_t.jpg');

	jupiterMaterial = new THREE.MeshPhongMaterial({
		color: 0xaaaaaa,
		ambient: 0xaaaaaa,
		specular: 0x333333,
		map: jupiterTexture,
		bumpMap: jupiterBumpTexture,
		bumpScale: 0.5,
		shininess: 10
	});

	planet = new THREE.Mesh(new THREE.SphereGeometry(4, 64, 64), earthMaterial);
	scene.add(planet);

	render();
}

// Toggle material to switch planet
function changePlanet() {
	if(planetType == 0)
	{// Change to Jupiter
		planetType = 1;
		planet.material = jupiterMaterial;
	}
	else
	{
		planetType = 0;
		planet.material = earthMaterial;
	}
}

// Render the scene
function render() {
	// Set animation frame callback to ensure continuous animation
	requestAnimationFrame(render);
		
	// Transform the geometry as needed
    var delta = clock.getDelta();
    planet.rotation.y += delta / 10;
	
	// Render
    renderer.render(scene, camera);
}
